string buffer = "";

int index = 0; // Index of the current marker
int marker_size = 14; // Size of the marker
List<char> markers = new List<char>(); // List of markers

foreach (var c in buffer)
{
    if (markers.Count >= marker_size)
    {
        if (markers.Distinct().Count() == marker_size)
        {
            Console.WriteLine($"Result: {index}");
            break;
        }
    
        markers.RemoveAt(0);
    }

    markers.Add(c);
    index += 1;
}



